'Review your settings'=>'Znovu shlédněte svá nastavení',
'GetStartedSettings'=>'Post Affiliate Pro je vytvořen tak, že dokáže pracovat s výchozím nastavením. <br/>Nicméně doporučujeme zkontrolovat konfiguraci a doladit ji podle vašich vlastních potřeb.<br/>Obrazovku s nastaveními naleznete v <strong>Menu nastavení a nástrojů -> Nastavení</strong>.<br/><br/>Detailní popis všech možností nastavení je k dispozici v Průvodci uživatele nebo ve znalostní bázi.',
'Define your commissions'=>'Definujte své provize',
'GetStartedCommissions'=>'První, výchozí, kampaň je vytvořena během instalace. Můžete ji modifikovat nebo vytvořit vaše vlastní kampaně.<br/><br/>
Kampaně se používají k seskupení souboru produktů (nebo jen jednoho produktu), které budou mít stejně nastavené provize.<br/><br/>
Například můžete mít kampaň pro Produkt1, kde budete své partnery odměňovat za proklik, a jinou kampaň pro Produkt2, kde partneři dostanou provizi z prodeje.<br/><br/>
Nebo můžete mít kampaň nazvanou Levné produkty, kde budou provize z prodeje 40%, a jinou kampaň nazvanou Drahé produkty s provizí 15% z prodeje.',
'Add banners and other creatives'=>'Přidejte bannery a další reklamní média',
'GetStartedCreatives'=>'Ve <strong>Správci bannerů</strong> naleznete různé reklamní prvky - od textových odkazů, standardních obrázkových bannerů až k HTML či Falshovým bannerům a bannerům pro reklamní e-maily.<br/>
Každý banner musí mít přesně určenou cílovou URL - je to URL, kam je návštěvník přesměrován po kliku.',
'Set up emails'=>'Nastavení e-mailů',
'GetStartedEmails'=>'Můžete nastavit funkce e-mailů. To zahrnuje: <ul><li><strong>mailový účet</strong> - jak budou e-maily odesílány. Můžete zvolit buď funkci mail() nebo SMTP server.</li><li><strong>šablony e-mailu</strong> - jsou šablony, které se používají, když systém rozesílá automatické e-maily, jako po registraci nebo zprávu o prodeji</li><li><strong>e-mailová upozornění</strong> - zde můžete nastavit, který druh upozornění chcete dostávat jako obchodník a která upozornění budou k dispozici pro partnery.</li></ul>Ujistěte se, že mailový účet je nastaven správně - odzkoušejte to odesláním mailů. Bez funkčního odesílání mailů nedostanou partneři potvrzení registrace atd.',
'Customize your affiliate signup form'=>'Upravit přihlašovací formulář partnerů',
'GetStartedSignupForm'=>'Zvolte standardní registrační formulář a upravte jej, pokud chcete.<br/><br/>
Registrační formulář je spojen s informační ministránkou, která obsahuje informace o partnerském programu atd.<br/>Tuto ministránku můžete využít nebo ji smazat a ponechat pouze registrační formulář.',
'Customize affiliate panel'=>'Upravit partnerský panel',
'GetStartedAffPanel'=>'Partnerský panel je v Post Affiliate Pro velmi flexibilní.<br/>Můžete v něm upravit vzhled menu, obsah, který tam chcte mít, a dokonce můžete vytvořit vlastní obsah nebo odkaz na další stránky.',
'GetStartedIntegrate'=>'Integrace je způsob propojení partnerského systému s vaší aktuální webovou stránkou, nákupním košíkem nebo platební bránou tak, aby partnerský systém byl informován o refferalech a objednávkách.<br/>
Když je upozorněn, partnerský systém zaregistruje prodej, nalezne odkazujícího partnera, pokud existuje, a vygeneruje pro něj odpovídající provizi.<br/><br/>
Integrace obvykle znamená přidání několika řádků kódu na vaše stránky a je popsána krok za krokem v Průvodci integrací pro většinu nejobvyklejších nákupních košíků a platebních systémů.',
'Test everything'=>'Vyzkoušet vše',
'GetStartedTest'=>'Poté, co byly nastaveny vaše kampaně, definovány správné provize a vytvořeny nějaké bannery/odkazy, můžete systém vyzkoušet.<br/>
Nejlepší je simulovat celý proces z partnerova a vašeho úhlu pohledu.
<ol>
<li>Zaregistrujte se jako testovací partner a po schválení byste měla/a dostat potvrzující e-mail s vaším heslem a měl/a byste se úspěšně přihlásit do partnerského panelu</li>
<li>Přihlašte se do partnerského panelu, získejte kód banneru/odkazu a vložte jej na Â nějakou testovací stránku.</li> 
<li>Klikněte na banner a zjistěte, zda yl klik zaregistrován</li>
<li>Po kliknutí udělejte zkušební nákup a ověřte, že provize z prodeje byla v partnerském systému zaregistrována (týká se pouze provizí z prodeje nebo leadu)</li>
</ol>

Pokud narazíte na nějaký problém v kterémkoli z těchto kroků, zapněte <strong>Zaznamenávání událostí pro vychytávání chyb</strong> a podívejte se na <strong>Řešení problémů</strong>',
'Promote your affiliate program'=>'Inzerujte svůj partnerský program',
'GetStartedPromote'=>'Poté, co jste úspěšně vyzkoušel/a integraci partnerského systému s vašimi stránkami, je vše připraveno k propagaci vašeho nového partnerského programu, takže přilákejte nové partnery, aby se přijali.<br/><br/>
Je nezbytné vložit odkaz na váš partnerský program nebo registrační formulář na vaše vlastní stránky. Nazvěte ten odkaz jako Partnerský program, Pro webmastery - vydělejte si! a podobně. To může z návštěvníků vašich stránek udělat vaše partnery.<br/><br/>
Abyste získali více potenciálních partnerů, vložte svůj program do seznamů partnerských programů - na internetu jsou jich desítky a jsou navštěvovány každý den tisíci zkušenými partnery.',
